import React from "react";
import Card from "./Card";
import Sdata from "./Sdata";



function App(){
    return(
        <>
    <h1 className="heading"> Top 5 Netflix List </h1>
    {Sdata.map((val) => {
        return(
        <Card 
        imgsrc = {val.imgsrc}
        catagory = {val.catagory}
        title = {val.title}
        link = {val.link}
      />
        )
    })};   
    </>
    );
};
export default App;
